import React, {useState} from 'react';

import Wrapper from '../UI/Wrapper/Wrapper';
import CarsList from './CarsList';
import CarInfo from './CarInfo';
import CarServices from './CarServices';

import classes from './Cars.module.css';

const Cars = (props) => {


  const [loadCar, setLoadCar] = useState('1');

  const listCars = props.userCars.map((cars) => {
    return cars.map((car) => {
      return cars = {
        id: car.id,
        brand: car.brand,
        series: car.series,
      };
    });
  });

  const onLoadCar = (carId) => {
    console.log(carId);
  }

  return (
    <Wrapper>
      <CarsList carsList={listCars} pickedCar={onLoadCar}/>
      <CarInfo />
      <CarServices />
    </Wrapper>
  );
};

export default Cars;
